patogēno mikroorganismu (baktēriju, riketsiju, vienšūņu) saglabāšanās klīniski vesela cilvēka vai dzīvnieka organismā un izdalīšanās ārējā vidē. Konstatēta arī vīrusu nēsāšana. Baktēriju nēsāšana vērojama veseliem cilvēkiem un tiem, kuri atveseļojas (rekonvalescentiem). Veseli cilvēki var būt nosacīti patogēno mikroorganismu (stafilokoku, dažu zarnu nūjiņu tipu u.c.) nēsātāji; tie var būt arī patogēno mikroorganismu nēsātāji, bet tikai tad, ja cilvēki ir imūni (potēti vai agrāk slimojuši). Baktē
