). Hroniskā baktēriju nēsāšana ir apslēptā bezsimptomu slimības forma (latentā infekcija). Baktēriju nēsāšana var izraisīt patoloģiskas pārmaiņas orgānos (piem., dizentērijas baktēriju nēsātājiem ir pārmaiņas zarnās), kā arī rada imunitāti. Baktēriju nēsātāji var būt infekcijas avots. Ar dažām infekciju slimībām (skarlatīnu, meningokoku infekciju, dizentēriju, vēdertīfu) cilvēki inficējas galvenokārt no baktēriju nēsātājiem. Baktēriju nēsāšanas profilakse: infekciju slimnieku izolēšana un racion
